tt School of Business are both Top 30 schools and host many of the top-ranked programs in the United States, including the No. 2 accounting program. BYU comes in at No. 20 overall in the 2024 Best Colleges in America rankings from The Wall Street Journal, joining the likes of Princeton, MIT, Yale, Stanford and Harvard in the top 25.\nSee byu.edu for more information about BYU rankings and admissions.","styleRuns":[{"startIndex":0,"length":1473,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1473,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"compositeVideoPrimaryInfoRenderer":{}},{"itemSectionRenderer":{"contents":[{"continuationItemRenderer":{"trigger":"CONTINUATION_TRIGGER_ON_ITEM_SHOWN","continuationEndpoint":{"clickTrackingParams":"CKMDELsvGAMiEwjT-tm1ioSPAxWjq_8EHQEbKWg=","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/next"}},"continuationCommand":{"token":"Eg0SC3FvaFpHVHFoWG1nGAYyJSIRIgtxb2haR1RxaFhtZzAAeAJCEGNvbW1lbnRzLXNlY3Rpb24%3D","request":"CONTINUATION_REQUEST_TYPE_WATCH_NEXT"}}}}],"trackingParams":"CKMDELsvGAMiEwjT-tm1ioSPAxWjq_8EHQEbKWg=","sectionIdentifier":"comment-item-section","targetId":"comments-section"}}],"trackingParams":"CKIDELovIhMI0_rZtYqEjwMVo6v_BB0BGylo"}},"secondaryResults":{"secondaryResults":{"results":[{"relatedChipCloudRenderer":{"content":{"chipCloudRenderer":{"chips":[{"chipCloudChipRenderer":{"style":{"styleType":"STYLE_DEFAULT"},"text":{"simpleText":"All"},"navigationEndpoint":{"clickTrackingParams":"CKEDELuJAxgAIhMI0_rZtYqEjwMVo6v_BB0BGylo","relatedChipCommand":{"targetSectionIdentifier":"sid-wn-chips","loadCached":true}},"trackingParams":"CKEDELuJAxgAIhMI0_rZtYqEjwMVo6v_BB0BGylo","isSelected":true}},{"chipCloudChipRenderer":{"style":{"styleType":"STYLE_DEFAULT"},"text":{"simpleTex
